import { HttpInterceptorFn, HttpResponse } from '@angular/common/http';
import { inject } from '@angular/core';
import { of } from 'rxjs';
import { APP_CONFIG } from 'src/environments/config/app-config.token';

export const mocksInterceptor: HttpInterceptorFn = (req, next) => {
  const mockEnabled = inject(APP_CONFIG).mocksEnabled;
  console.log(`INTERCEPTOR MOCKS ${mockEnabled}`);
  const mockToDos = [{
    userId: 1,
    id: 99,
    title: 'test',
    completed: false
  }];
  if (mockEnabled) {
    return of(new HttpResponse({
      status: 200, body: "data:image/png;base64,"
    }));
  }
  return next(req);
};
